import React from "react";
import Table from "react-bootstrap/Table";

const Showdata = ({
  InvoiceNumber,
  InvoiceDate,
  ProductName,
  Pack,
  ActualRate,
  Quantity,
}) => {
  return (
    <Table striped bordered hover>      
      <thead>
            <tr>
            <th>Invoice Number</th>
            <th>Invoice Date</th>
            <th>ProductName</th>
            <th>Pack</th>
            <th>Actual Rate</th>
            <th>Quantity</th>
            </tr>
        </thead>
        <tbody>
        <tr>
          <td>{InvoiceNumber}</td>
          <td>{InvoiceDate}</td>
          <td>{ProductName}</td>
          <td>{Pack}</td>
          <td>{ActualRate}</td>
          <td>{Quantity}</td>
        </tr>
      </tbody>
    </Table>
  );
};

export default Showdata;
